import React from "react";
import Form from "react-bootstrap/Form";
import { useDispatch, useSelector } from "react-redux";
import { useNavigate } from "react-router";
import { qtActions } from "../action/QtAction";

const Qttime = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const error = useSelector((state) => state.qt.error);
  const [formData, setFormData] = {
    date: "",
    main: "",
    meditContent: "",
  };

  function addingQt(evt) {
    evt.preventDefault();
    const { data, main, meditContent } = formData;
    dispatch(qtActions.addQt({ data, main, meditContent }));
  }

  function handleChange(evt) {
    evt.preventDefault();
    const { name, value } = evt.target;
    setFormData({ ...formData, [name]: value });
  }

  return (
    <Container className="register-area">
      <Form onSubmit={addingQt}>
        <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
          <Form.Label>날짜</Form.Label>
          <Form.Control
            name="date"
            type="date"
            placeholder="날짜"
            onChange={handleChange}
          />
        </Form.Group>

        <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
          <Form.Label>본문말씀</Form.Label>
          <Form.Control
            name="main"
            type="text"
            placeholder="본문 말씀"
            onChange={handleChange}
          />
        </Form.Group>

        <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
          <Form.Label>묵상 내용</Form.Label>
          <Form.Control
           name="meditContent" 
           type='text'
           onChange={handleChange}
           as="textarea" 
           rows={5} />
        </Form.Group>
        <Button variant="danger" type="submit">
          저장
        </Button>
      </Form>
    </Container>
  );
};

export default Qttime;
